// Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Home.module.css'
function Home() {
  return (
    <div className="app-container">
      <h1>Welcome to Cuffless Blood Pressure Monitoring System</h1>
      <Link to="/register">
        <button>Register Patient Details</button>
      </Link>
      <Link to="/select-patient"> {/* Navigate to SelectPatient page */}
        <button>View Patient Data</button>
      </Link>
    </div>
  );
}

export default Home;
